import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { NavItem } from "./NavItem";
import styled from "styled-components";
import { getCurrentUser, logout, logoutUser } from "../../Api/UserApi/UserApi"; // 로그아웃 API 호출을 추가했다고 가정

const Container = styled.div`
  width: 100%;
  display: flex;
  background-color: dodgerblue;
  position: relative;
  justify-content: center; /* 수평 중앙 정렬 */
`;

const StyledLink = styled(Link)`
  text-decoration: none;
  color: white;
  padding: 5px;
  background-color: dodgerblue;
  &:hover {
    background-color: blue;
  }
  &:active {
    background-color: darkblue;
  }
`;

export function Navbar() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const navigate = useNavigate(); // react-router-dom v6의 useNavigate 훅

  useEffect(() => {
    const checkAuth = async () => {
      try {
        const user = await getCurrentUser();
        setIsAuthenticated(!!user); // 사용자 정보가 있으면 로그인 상태로 설정
      } catch (error) {
        setIsAuthenticated(false); // 오류가 발생하면 로그아웃 상태로 설정
      }
    };

    checkAuth();
  }, []);

  const handleLogout = async () => {
    setIsAuthenticated(false); // 로그아웃 후 상태를 즉시 업데이트하여 UI 변경
    try {
      await logout(); // 로그아웃 API 호출 (비동기 작업)
      navigate("/login"); // 로그아웃 후 로그인 페이지로 이동
    } catch (error) {
      console.error("로그아웃 실패:", error);
    }
  };

  return (
    <Container>
      <StyledLink to="/home">
        <NavItem icon="ti ti-home" name="홈" />
      </StyledLink>
      <StyledLink to="/lecture">
        <NavItem icon="ti ti-device-tv" name="강의" />
      </StyledLink>
      <StyledLink to="/cart">
        <NavItem icon="ti ti-shopping-cart" name="장바구니" />
      </StyledLink>
      <StyledLink to="/mypage/user">
        <NavItem icon="ti ti-user" name="마이페이지" />
      </StyledLink>
      <StyledLink to="/community">
        <NavItem icon="ti ti-friends" name="커뮤니티" />
      </StyledLink>

      {isAuthenticated ? (
        <StyledLink to="/logout" onClick={handleLogout}>
          <NavItem icon="ti ti-logout" name="로그아웃" />
        </StyledLink>
      ) : (
        <StyledLink to="/login">
          <NavItem icon="ti ti-login" name="로그인" />
        </StyledLink>
      )}

      {isAuthenticated && (
        <StyledLink to="/admin/user">
          <NavItem icon="ti ti-settings" name="관리자" />
        </StyledLink>
      )}
    </Container>
  );
}
